def find_pythagorean_triplets(n):
    result = []
    for i in range(1, n + 1):
        for j in range(i + 1, n + 1):
            for k in range(j + 1, n + 1):
                if (i ** 2 + j ** 2 == k ** 2 and i + j + k == n):
                    result.append((i, j, k))
    return result

